function _prepareKeys(uint32[] memory keys, uint32 maxSpread) internal view {
    uint32 lastKey = 0;
    for (uint256 i = 0; i < keys.length; ++i) {
        uint32 key = _boundUint32(keys[i], lastKey, lastKey + maxSpread);
        keys[i] = key;
        lastKey = key;
    }
}

